import { GET_FILTERS_TYPE, GET_FILTERS_MANUFACTURE } from "./types";

// Get Type Filter
export const getFiltersType = data => dispatch => {
  dispatch({
    type: GET_FILTERS_TYPE,
    payload: data
  });
};

// Get Manufacture Filter
export const getFiltersManufacture = data => dispatch => {
  dispatch({
    type: GET_FILTERS_MANUFACTURE,
    payload: data
  });
};
